import React from "react";

export default function SplitGender(props) {
  function compare(a, b) {
    if (a.name < b.name) {
      return -1;
    }
    if (a.name > b.name) {
      return 1;
    }
    return 0;
  }
  return ArrayOfBabyNames.sort((a, b) => {
  let fa = a.name,
    fb = b.name;

  if (fa < fb) {
    return -1;
  }
  if (fa > fb) {
    return 1;
  }
  return 0;
});


